import React, { useState, useEffect } from 'react';
import { Container, Form, Input, Button, ErrorMessage } from './LoginStyle';
import api from '../../axios/axios';
import axios from 'axios';

const Login = () => {
  const [cliente, setCliente] = useState({
    name: '',
    chaveDeAcesso: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCliente({
      ...cliente,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const data = {
      name: cliente.name,
      chaveDeAcesso: cliente.chaveDeAcesso,
    };
    console.log("Formulário enviado:", data);
    try {
      const response = await axios.post('https://projetoinicialusr.onrender.com/v1/users/', {
        headers: {
          'Content-Type': 'application/json'
        }
      });
      alert('Cliente criado com sucesso!'); 
      setCliente({
        chaveDeAcesso: '',
        name: '',
        cpf: '',
        email: '',
        profissao: '',
        sexo: ''
      });

    } catch (error) {

      if (error.response) {
        console.error('Erro na resposta:', error.response.data);
        console.error('Status:', error.response.status);
        console.error('Headers:', error.response.headers);
        alert('Erro ao criar cliente: ' + error.response.data.message);
      } else if (error.request) {
        console.error('Erro na requisição:', error.request);
        alert('Erro ao criar cliente: Sem resposta do servidor');
      } else {
        console.error('Erro:', error.message);
        alert('Erro ao criar cliente: ' + error.message);
      }
      console.error('Configuração da requisição:', error.config);
    }
  };
    return (
      <Container>
        <Form>
          <h2>Login</h2>
          <Input
            type="text"
            placeholder="Usuário"
          />
          <Input
            type="password"
            placeholder="Senha"
          />
          <Button type="submit">Entrar</Button>
        </Form>
      </Container>
    );
  };

  export default Login;
